use crate::{note::{note_header::NoteHeader, note_interface::NoteInterface}, utils::array};

use dep::protocol_types::{
    address::AztecAddress,
    indexed_tagging_secret::{INDEXED_TAGGING_SECRET_LENGTH, IndexedTaggingSecret},
