                inner: Point {
                    x: serialized[6],
                    y: serialized[7],
                    is_infinite: serialized[8] as bool,
                },
            },
            tpk_m: TpkM {
                inner: Point {
                    x: serialized[9],
                    y: serialized[10],
                    is_infinite: serialized[11] as bool,
                },
            },
        }
    }
}

